	return (
    <div className="wrapper-footer">

			<div className="wrapper-icon-footer">
				<img 
					src={iconAddFiles} 
					className="icon-footer" 
					alt="iconAddFiles"
				/>
			</div>

			<div className="wrapper-input-message">
				<input className="input-message">

				</input>
			</div>

			<div className="wrapper-icon-footer">
				<img 
					src={iconAddFiles} 
					className="icon-footer" 
					alt="iconAddFiles"
				/>
			</div>

		</div>
	);
};

export default Footer;
